import {Link } from 'react-router-dom'

interface NavbarSectionProps {
  title: string
  link: string

}

const NavbarSection = ({title, link}:NavbarSectionProps) =>
{
  return(

      <div className="px-4 hover:bg-gray-200">
        <Link to={link} className="no-underline text-black h-[100%] cursor-pointer">
        <p>
          {title}
        </p>
        </Link>

      </div>
  )
}

export default NavbarSection
